      <>
        <h3>Welcome to</h3>
        <h2>OUR REMINDER</h2>
      </>
    color: #b4a0a0;
      <div className='to-do' style={{textAlign: 'center', margin: 'auto', padding: '5px', width: '350px', color: ''}}>
